import React, { useState } from 'react';
import classNames from 'classnames';
import IEducationItem from '../../typescript/Interfaces/IEducationItem';
import styles from './TimelineItem.module.scss';

const { container, rightSide, content, year: yearStyle } = styles;
interface ITimelineItemProps {
  children: React.ReactNode;
  year: string;
}

const TimelineItem = ({ year, children }: ITimelineItemProps) => (
  <div className={container}>
    <div className={yearStyle}>{year}</div>
    <div className={rightSide}>
      <div className={content}>{children}</div>
    </div>
  </div>
);

export default TimelineItem;
